import React from 'react';
import './index.css';

class Header extends React.Component {
    render() {
        return (
            <main>
            <div className="container">
              <header className="header">
                <div className="btn-blog">
                  <a href="#">BOLG</a>
                </div>
                <button href="#">Register</button>
                <button href="#">Login</button>
              </header>
            </div>
          </main>
        )
    }
}

export default Header;
